2 
1.1.  I punësuari  - personi fizik i  punësuar për të kryer punë ose shërbime me pagesë për 
punëdhënësin;  

1.2.  Punëdhënësi - personi fizik ose juridik i cili i siguron punë të  punësuarit dhe i paguan pagën 
për punën ose për  shërbimet e kryera;  

1.3.  Sektori publik   - sektori i arsimit, të shëndetësisë si dhe ndërm arrjet publike të cilat janë 
pronësi e Republikës së Kosovës apo e ndonjërës nga  komunat e Republikës së Kosovës; 

1.4 .  Dialogu Social -  procesi demokratik i konsultimeve dhe i  shkëmbimi t të informatave në 
mes të përfaqësuesve të punëdhënësve, punëmarrësve dhe përfaqësuesve të Qeverisë; 

1.5.  Këshilli Ekonomiko-Social  (KES) - organi i nivelit nacional i cili udhëheq k onsultimet për 
çështjet nga  marrëdhënia e punës, mirëqenia social e dhe çështjet tjera të cilat kanë të bëjnë  me  
politikat  ekonomike  në Republikën e  Kosovës;   

1.6 .  Organizatat e të punësuarve -  sindikatat të cilat janë të pavarura,  vullnetar e, e themeluar 
për realizimin dhe mbrojtjen e të drejtave të të punësuarve; 

1.7.   Organizata e punëdhënësve - organizatë në të cilën punëdhënësit bashkohen vul lnetarisht  
për mbrojtjen e interesave të tyre; 

1.8.  Kontrata Kolektive  - marrëveshja ndërmjet organizatave të punëdhënësv e dhe 
organizatave të të punësuarve me të cilën rregulloh en të drejtat, detyrat dhe përgjegjësitë që 
rrjedhin nga marrëdhënia e punës sipas marrëveshjes  së arritur; 

1.9.  Akti i Brendshëm i Punëdhënësit -  akti i cili rregullon të drejtat, detyrat dhe përg jegjësitë 
që rrjedhin nga marrëdhënia e punës, në pajtim me k ëtë ligj dhe me Kontratën Kolektive; 

1.10.   Marrëdhënia e Punës  - një marrëveshje ose rregullim kontraktual ndërmj et një 
punëdhënësi dhe të punësuarit për kryerjen e detyra ve dhe përgjegjësive specifike nga i 
punësuari nën mbikëqyrjen e punëdhënësit, kundrejt një pagese të dakorduar, zakonisht në 
formë të parave; 

1.11.  Kontrata e Punës  - akti individual e cila lidhet ndërmjet punëdhënë sit dhe të punësuarit, 
me të cilën rregullohen të drejtat, detyrat dhe për gjegjësitë që rrjedhin nga marrëdhënia e punës 
në pajtim me këtë ligj, me Kontratën Kolektive dhe me Aktin e Brendshëm të Punëdhënësit; 

1.12 .  Praktikanti -  personi i kualifikuar i cili themelon për herë të parë marrëdhënie pune, me 
qëllim që gjatë  punës praktike të aftësohet për punë të caktuara ; 

1.13. Paga -  shpërblimi ose fitimi i çfarëdo niveli të llogarit ur e shprehur në para për të 
punësuarin; 

1.14.  Paga minimale  - pagesa minimale e propozuar  nga KES-i  ndërsa e  vendosur nga 
Qeveria, sipas kritereve të përcaktuara me këtë  në pajtim me këtë ligj;  

1.15.  Puna e detyruar ose e dhunshme  - puna ose shërbimet të cilat kërkohen të kryhen n ën 
kërcënim me ndëshkim, për të cilat i punësuari  nuk  shpreh vullnet t’i kryejë; 

1.16.  Anëtarët e familjes së ngushtë  - bashkëshorti/ja, fëmijët martesorë dhe jashtë ma rtesorë, 
fëmijët e birësuar, vëllezërit, motrat dhe prindërit;  

1.17.  Diskriminimi  - çdo dallim që përfshin përjashtim ose dhënie të përparësisë në bazë të 
racës, ngjyrës, gjinisë, fesë, moshës, gjendjes fam iljare, mendimit politik, prejardhjes kombëtare 
ose sociale, gjuhës ose anëtarësisë sindikale, që e  ka fuqinë e anulimit ose mosdhënies së 
mundësive të barabarta për punësim apo profesion ap o ngritje profesionale 

1.18.  Ministria  - Ministria e Punës dhe Mirëqenies Sociale (MPMS);

5 
8. Të punësuarit  për një punë specifike, nuk i tak on e drejta në pushim vjetor dhe të drejtat e tjera  të 
përcaktuara me Kontratë Kolektive dhe Kontratën e P unës. 

9. Me Kontratën Kolektive, Aktin e Brendshëm të Pun ëdhënësit, përcaktohet  koha  në  rastet kur me të 
punësuarin mund të themelohet marrëdhënia e punës n ë kohë të caktuar dhe punë specifike, në pajtim 
me këtë ligj.  

Neni 11 
Përmbajtja e Kontratës së Punës 

1.   Kontrata e Punës përmban; 

1.1.  të dhënat për punëdhënësin (emërtimi, selia d he numrin e regjistrimit të biznesit);  

1.2.   të dhënat për të punësuarin (emri, mbiemri, kualifikimi dhe vendbanimi ); 

1.3.  emërtimin, natyrën, llojin e punës, llojin shërbimeve dhe përshkrimin e  detyrave të punës; 

1.4.   vendin e punës dhe njoftimin  që puna do të kryhet në lokacione të ndryshme, 

1.5.   orët  dhe orarin e punës; 

1.6.   datën e fillimit të punës; 

1.7.   kohëzgjatjen e Kontratës së Punës; 

1.8.   lartësinë e pagës bazë, si dhe ndonjë shtesë ose të ardhur tjetër, 

1.9.   kohëzgjatjen e pushimeve; 

1.10.  përfundimin e marrëdhënies së  Punës;   

1.11. të dhëna të tjera për të cilat punëdhënësi dh e punëmarrësi i vlerësojnë të rëndësishme për 
rregullimin e marrëdhënies së punës; 

1.12.  kontrata e Punës mund të përmbajë të drejta dhe detyra të tjera të parashikuara me këtë 
ligj; 

1.13.  të drejtat dhe detyrimet të cilat nuk janë t ë përcaktuara me Kontratën e Punës, rregullohen 
me dispozitat e këtij ligji, Kontratën Kolektive dhe Aktin e Brendshëm të Punëdhënësit; 

2. Ministria e Punës dhe Mirëqenies Sociale për nev ojat e punëdhënësve do të përgatisë mostra të 
kontratave të punës sipas standardeve minimale, për  periudhë të pacaktuar, të caktuar dhe për punë 
specifike. 

Neni  12 
Vazhdimi i punësimit 

1. Vazhdimi i punësimit të të punësuarit, nuk konsi derohet si ndërprerje e marrëdhënies së punës, si n ë 
rastet e mëposhtme: 

1.1.  pas shfrytëzimit të pushimit vjetor,  pushimi t mjekësor, pushimit të lehonisë ose çfarëdo 
pushimi tjetër të marrë në  përputhje me ligjin; 

1.2.  pas suspendimit të tij nga vendi i  punës  me  ose pa pagesë,  në përputhje  me këtë ligj; 

1.3.  ndërmjet ndërprerjes të kontratës së punës së tij dhe datës së rikthimit efektiv sipas vendimit 
të gjykatës ose organit të ngjashëm në përputhje me  këtë ligj; 

1.4.  me pëlqimin e punëdhënësit.
